import {React} from 'react';
import {Container} from '@material-ui/core';
import Navbar from './components/Navbar/Navbar.js';
import Home from './components/Home/Home';
import Auth from './components/Auth/Auth';
import {BrowserRouter, Switch, Route} from 'react-router-dom';

const App = ( ) => {

  return(
    <BrowserRouter>
    <Container maxWidth='lg'>
      <Navbar/>
      <Switch>
        <Route path='/' exact component={Home}/>
        <Route path='/auth' exact component={Auth}/>
      </Switch>
    </Container>
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320"><path fill="#eb0fff" fill-opacity="1" d="M0,224L26.7,202.7C53.3,181,107,139,160,149.3C213.3,160,267,224,320,213.3C373.3,203,427,117,480,69.3C533.3,21,587,11,640,58.7C693.3,107,747,213,800,213.3C853.3,213,907,107,960,74.7C1013.3,43,1067,85,1120,122.7C1173.3,160,1227,192,1280,176C1333.3,160,1387,96,1413,64L1440,32L1440,320L1413.3,320C1386.7,320,1333,320,1280,320C1226.7,320,1173,320,1120,320C1066.7,320,1013,320,960,320C906.7,320,853,320,800,320C746.7,320,693,320,640,320C586.7,320,533,320,480,320C426.7,320,373,320,320,320C266.7,320,213,320,160,320C106.7,320,53,320,27,320L0,320Z"></path></svg>
    </BrowserRouter>
    
  )
}

export default App
